        <div>
          <label for="usernameTxt">Username</label>
          <br />
          <input
            type="text"
            id="usernameTxt"
            placeholder="Username"
            v-model="usernameTxt"
            required
          />
        </div>
        <div>
          <label for="passwordTxt">Password</label>
          <br />
          <input
            type="password"
            id="passwordTxt"
            placeholder="Password"
            v-model="passwordTxt"
            required
          />
        </div>
        <div>
          <p>
            N√£o tem conta criada?
            <u
              ><router-link :to="{ name: 'Register' }"
                >Registe-se agora</router-link
              ></u
            >
          </p>
          <input type="submit" value="Login" id="loginBtn" />
        </div>
      </form>
    </div>
  </div>
</template>

<script>
import { mapGetters } from "vuex";
export default {
  data: () => {
    return {
      usernameTxt: "",
      passwordTxt: "",
      loggedUser: "",
      token: ""
    };
  },
  computed: {
    ...mapGetters(["getLoggedUser", "getLoginStatus", "getLoginToken"])
  },
  methods: {
    async signIn() {
      this.$store.commit("SET_LOGIN_FORM", {
        username: this.usernameTxt,
        password: this.passwordTxt
      });

      this.$store.commit("SET_LOGIN_STATUS", {
        status: true
      });

      console.log(this.usernameTxt, this.passwordTxt);

      try {
        await this.$store.dispatch("setLoggedUser");

        let status = this.getLoginStatus;

        if (status == 200) {
          this.loggedUser = this.getLoggedUser;
          this.token = this.getLoginToken;

          // show success notification
          this.notificationSuccess();

          // reset form
          this.resetForm();

          this.$router.push({ name: "DashboardHome" });
        } else {
          // show error notification
          this.notificationError();

          // reset form
          this.resetForm();
        }
      } catch (error) {
        console.log(`App: ${error}`);
        return error;
      }
    },
    resetForm() {
      this.usernameTxt = "";
      this.passwordTxt = "";
    },
    notificationSuccess() {
      this.$toast.success("Login efetuado com sucesso!", {
        position: "top-right",
        timeout: 3000,
        closeOnClick: true,
        pauseOnFocusLoss: true,
        pauseOnHover: true,
        draggable: true,
        draggablePercent: 0.6,
        showCloseButtonOnHover: false,
        hideProgressBar: true,
        closeButton: "button",
        icon: true,
        rtl: false
      });
    },
    notificationError() {
      this.$toast.error("Utilizador n√£o encontrado!", {
        position: "top-right",
        timeout: 3000,
        closeOnClick: true,
        pauseOnFocusLoss: true,
        pauseOnHover: true,
        draggable: true,
        draggablePercent: 0.6,
        showCloseButtonOnHover: false,
        hideProgressBar: true,
        closeButton: "button",
        icon: true,
        rtl: false
      });
    }
  }
};
</script>
